def test(cases, solutions, function, show_answer=True):
    correct = 0
    for case in cases:
        if show_answer: 
            print(f"Input: ")
            show_matrix(case)
        start_time = time.time()
        result = function(case)
        end_time = time.time() - start_time
        if show_answer: 
            print(f"Output Actual: ")
            show_matrix(result)
        if show_answer: 
            print(f"Output Expected: ")
            show_matrix(solutions[cases.index(case)])
        correct = correct+1 if result == solutions[cases.index(case)] else correct
        if show_answer:print(f"Correct: {result == solutions[cases.index(case)]}\n")
        print(f"Speed: Case {cases.index(case)+1}: {end_time} seconds ---")
    print(f" Correct {correct} out of {len(cases)}")
    print("=============================================")


